pragma solidity >=0.8.2 <0.9.0;

contract LoteriaGuille {
    address public owner;
    bool public isActive;
    address public ganador;

    struct Participante {
        address participante;
        uint256 numero;
    }

    mapping(address => uint256) public deposits;
    Participante[] public participantes;

    event NuevoParticipante(address indexed ofertante, uint256 numero);
    event LoteriaFinalizada(address indexed ganador, uint256 numero);

    modifier soloOwner() {
        require(msg.sender == owner, "No tienes permiso para ejecutar esta funcion");
        _;
    }

    modifier loteriaActiva() {
        require(isActive, "La loteria esta cerrada");
        _;
    }

    constructor() {
        owner = msg.sender;
        isActive = true;
        ganador = address(0);
    }

    function concursar(uint256 _numero) public payable loteriaActiva {
        require(msg.value >= 1, "El monto debe ser al menos de 1 wei para participar.");
        require(_numero <= 150, "Son solo 150 numeros");

        participantes.push(Participante(msg.sender, _numero));

        emit NuevoParticipante(msg.sender, _numero);
    }

    function mostrarConcursantes() public view returns (Participante[] memory) {
        return participantes;
    }

    function sortear() public soloOwner {
        require(isActive, "La loteria ya ha sido finalizada");
        require(participantes.length > 0, "No hay participantes en la loteria");

        // Selección de un índice aleatorio
        uint256 randomIndex = uint256(
            keccak256(
                abi.encodePacked(block.timestamp, block.prevrandao, msg.sender)
            )
        ) % participantes.length;

        // Asignación de ganador
        ganador = participantes[randomIndex].participante;

        // Obtención de premio (balance total del contrato)
        uint256 premio = address(this).balance;

        // Marcar la lotería como finalizada
        isActive = false;

        // Transferencia de fondos al ganador usando call
        (bool success, ) = ganador.call{value: premio}("");
        require(success, "La transferencia de fondos al ganador ha fallado");

        // Emitir el evento de lotería finalizada con el ganador y el premio
        emit LoteriaFinalizada(ganador, participantes[randomIndex].numero);
}


}

